import Constants from 'expo-constants';

export const env = {
    API_BASE_URL: Constants.expoConfig.extra.API_BASE_URL,
    LOCAL_STORAGE_CURRENT_USER_KEY: Constants.expoConfig.extra.LOCAL_STORAGE_CURRENT_USER_KEY,
}
